    alignItems: "center",
    justifyContent: "center",
    overflowX: "auto",
    whiteSpace: "nowrap",
    cursor: "grab",
  },
}));

const rawEdges = dependencies.map((d) => ({
  id: `e-${d.input}->${d.view}`,
  source: d.input,
  target: d.view,
  animated: false,
  style: { stroke: "grey", strokeWidth: 2 },
  markerEnd: { type: MarkerType.ArrowClosed, color: "grey" },
}));

// apply dagre layout once at the start
const { nodes: initialNodes, edges: initialEdges } = getLayoutedElements(
  rawNodes,
  rawEdges
);

// ---- UTILS FOR HIGHLIGHT ----
const buildParentMap = (edges) => {
  const parentMap = {};
  edges.forEach((e) => {
    if (!parentMap[e.target]) parentMap[e.target] = [];
    parentMap[e.target].push(e.source);
  });
  return parentMap;
};

const getAllAncestors = (nodeId, parentMap) => {
  const visited = new Set();
  const stack = [nodeId];
  const ancestorEdges = [];

  while (stack.length > 0) {
    const current = stack.pop();
    const parents = parentMap[current] || [];
    parents.forEach((p) => {
      ancestorEdges.push({ source: p, target: current });
      if (!visited.has(p)) {
        visited.add(p);
        stack.push(p);
      }
    });
  }

  return ancestorEdges;
};

// ---- FILTER PANEL COMPONENT ----
function FilterPanel({ filters, setFilters }) {
  return (
    <div style={{ padding: "10px", background: "#f8f9fa", borderBottom: "1px solid #ddd", display: "flex", gap: "12px", alignItems: "center" }}>
      <div>
        <label>Start Date: </label>
        <input
          type="date"
          value={filters.startDate}
          onChange={(e) => setFilters({ ...filters, startDate: e.target.value })}
        />
      </div>
      <div>
        <label>Start Hour: </label>
        <input
          type="number"
          min="0"
          max="23"
          value={filters.startHour}
          onChange={(e) => setFilters({ ...filters, startHour: e.target.value })}
        />
      </div>
      <div>
        <label>End Date: </label>
        <input
          type="date"
          value={filters.endDate}
          onChange={(e) => setFilters({ ...filters, endDate: e.target.value })}
        />
      </div>
      <div>
        <label>End Hour: </label>
        <input
          type="number"
          min="0"
          max="23"
          value={filters.endHour}
          onChange={(e) => setFilters({ ...filters, endHour: e.target.value })}
        />
      </div>
      <div>
        <label>Product: </label>
        <select
          value={filters.productName}
          onChange={(e) => setFilters({ ...filters, productName: e.target.value })}
        >
          <option value="Audience">Audience</option>
        </select>
      </div>
    </div>
  );
}

// ---- MAIN APP ----
export default function App() {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);

  const [filters, setFilters] = useState({
    startDate: "",
    startHour: "",
    endDate: "",
    endHour: "",
    productName: "Audience",
  });

  const parentMap = buildParentMap(initialEdges);

  const onNodeClick = useCallback(
    (_, node) => {
      const ancestorEdges = getAllAncestors(node.id, parentMap);

      setEdges((eds) =>
        eds.map((e) => {
          const isHighlighted = ancestorEdges.some(
            (ae) => ae.source === e.source && ae.target === e.target
          );

          if (isHighlighted) {
            return {
              ...e,
              animated: true,
              style: {
                stroke: "red",
                strokeWidth: 4,
                strokeDasharray: "5 5",
              },
              markerEnd: { type: MarkerType.ArrowClosed, color: "violet" },
            };
          }

          return {
            ...e,
            animated: false,
            style: { stroke: "grey", strokeWidth: 2 },
            markerEnd: { type: MarkerType.ArrowClosed, color: "grey" },
          };
        })
      );
    },
    [setEdges, parentMap]
  );

  return (
    <div style={{ width: "100vw", height: "100vh", display: "flex", flexDirection: "column" }}>
      {/* Filter panel on top */}
      <FilterPanel filters={filters} setFilters={setFilters} />

      {/* Graph area */}
      <div style={{ flex: 1 }}>
        <ReactFlow
          nodes={nodes}
          edges={edges}
          onNodesChange={onNodesChange}
          onEdgesChange={onEdgesChange}
          onNodeClick={onNodeClick}
          minZoom={0.4}
          maxZoom={5}
          fitView
          nodesDraggable
        >
          <MiniMap />
          <Controls />
          <Background />
        </ReactFlow>
      </div>
    </div>
  );
}
